import React, {Component} from 'react';
import './style.scss';

class Login extends Component{
  render(){
    return (
<div>
  <header>
    <div classname="logo">
      <img alt="logo" src="https://media.licdn.com/dms/image/C4E0BAQFEytJiVBb7iQ/company-logo_200_200/0?e=2159024400&v=beta&t=LLn7VJVAc66HoioXbsOxuBb_Ye5mONuTbPoMCSycJTw" />
    </div>
  </header>
  <div classname="container content">
    <div classname="row">
      <div classname="col-md-6 Right" />
      <div classname="col-md-6 Left" />
    </div>
  </div>
</div>

  );
  }
}

export default Login;
